import React, { Component } from 'react';
import { firebaseDatabase } from "./firebase";
import { NgxGaugeModule } from 'ngx-gauge';

export default class LineGraph extends Component{

render(){
    return(
        <div>
    <NgxGaugeModule 

    gaugeType = {"semi"}
    gaugeValue = {28.3}
    gaugeLabel = {"Speed"}
    gaugeAppendText = {"km/hr"}

/>
</div>)
}
}
